import "./NavBar.scss"

import TextField from "@material-ui/core/TextField"
import InputAdornment from "@material-ui/core/InputAdornment"
import LockOutlinedIcon from "@material-ui/icons/LockOutlined"
import IconButton from "@material-ui/core/IconButton"
import Visibility from "@material-ui/icons/Visibility"
import VisibilityOff from "@material-ui/icons/VisibilityOff"
import Button from "@material-ui/core/Button"

const handleKeyDown = () => {}
const handleChange = () => {}
const handleClickShowPassword = () => {}
const inputRefs = {}
const showPassword = true
const validUsername = () => {return {valid: true}}
const validPassword = () => {return {valid: true}}

const NavBar = props => <div className="NavBar">
  Login:

  <TextField
    id="username"
    inputRef={ref => { inputRefs.username = ref }}
    label="Enter Username"
    variant="outlined"
    margin="dense"
    autoComplete="username"
    autoFocus
    required
    onKeyDown={handleKeyDown}
    onChange={handleChange}
    style={{ backgroundColor: "white", margin:"5px" }}
  />

  <TextField
    id="password"
    inputRef={ref => { inputRefs.password = ref }}
    label="Enter Password"
    variant="outlined"
    margin="dense"
    autoComplete="password"
    required
    onKeyDown={handleKeyDown}
    onChange={handleChange}
    InputProps={{ type: showPassword ? "text" : "password",
    endAdornment: (
      <InputAdornment position="end">
        <IconButton onClick={handleClickShowPassword}>
          {showPassword ? <Visibility/> : <VisibilityOff/>}
        </IconButton>
      </InputAdornment>
    )
    }}
    style={{ backgroundColor: "white", margin:"5px" }}
  />

  <Button
    id="login"
    color="primary"
    variant="contained"
    disabled={!validUsername().valid || !validPassword().valid}
    onClick={() => props.login(username, password)}
    style={{ margin:"5px" }}
  > Sign In </Button>

</div>

export default NavBar
